import React from 'react'

const HeaderIcons = () => {
  return (
    <div className="home_social">

        <a href="https://www.linkedin.com/in/shanmukha-kartheek-kota-146a5022a" className='home_social-link' target='_blank'>
            <i class="fa-brands fa-linkedin"></i>
        </a>
    </div>
  )
}

export default HeaderIcons
